import React from 'react'
import { Box, Typography } from '@mui/material'

const SidebarCard = () => {
    return (
        <Box sx={{
            width: '200px',
            height: '200px',
            textAlign: 'center',
            backgroundColor: 'white'
        }}>
            <Typography>Weight Training</Typography>
        </Box>
    )
}

export default SidebarCard
